const date = new Date()
switch (date.getDay()) {
    case 0:
        break;
    case 1:
        break;
    case 2:
        break;
    case 3:
        break;
    case 4:
        console.log("hello");
        break;
    case 5:
        break;
    case 6:
        break;
}

const monday = date


const shifts =
        [
            {
                title: `${date}`,
                startTime: `${monday.getUTCDate(monday.setDate(monday.getDate() + 7))}`,
            }
        ]

export default shifts
